import React from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

function Navbar() {
  return (
    <nav class="navbar">
  <div class="navbar-container">
    <a href="/" class="navbar-logo">Mentor Match</a>
    <ul class="navbar-menu">
      <li class="navbar-item"><a href="/" class="navbar-link">Home</a></li>
      <li class="navbar-item"><a href="/mentors" class="navbar-link">Mentors</a></li>
      <li class="navbar-item"><a href="/students" class="navbar-link">Students</a></li>
      <li class="navbar-item"><a href="/assign" class="navbar-link">Assign/change mentor </a></li>
    </ul>
    <button class="navbar-toggle">â˜°</button>
  </div>
</nav>
  );
}

export default Navbar;
